import "./intro.css";

import { FaAward } from "react-icons/fa";
import React from "react";
import { VscFolderLibrary } from "react-icons/vsc";
import img from "../../assets/Me.webp";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { MDBContainer, MDBRow, MDBCol } from 'mdb-react-ui-kit';

const Intro = () => {
  return (
    <section id="about" >
      <h5>Get to know</h5>
      <h2>About Me</h2>
      <div className="container about__container">

        <div className="about__content">
          <div className="about__cards">
            <div className="about__card">
            <FaAward className="about__icon" />
              <h3>Education</h3>
              <h4>Victoria University of Wellington</h4>
              <p> July 2023 - present | Wellington, NZ<br />
                M.S. in Software development</p >

              <h4>Boston University</h4>
              <p>Master of Science, Statistics</p>
              <p>2015 - 2016</p>
            </div>
            <div className="about__card">
            <VscFolderLibrary className="about__icon" />
              <h3>Work Experience</h3>
              <p><strong>Li Auto</strong><br />
                Dec 2020 - May 2023 | Beijing, China<br />
                Data Scientist</p >

              <p><strong>Ai Bank</strong><br />
                Dec 2018 - Nov 2020 | Beijing, China<br />
                Data Analyst</p >
            </div>
          </div>
        </div>



        <a href="#contact" className="btn btn-primary">
          Let's Talk
        </a>
      </div>
    </section >
  );
};

export default Intro;
